from collections import defaultdict

def minimum_collection_cost(N, coordinates):
    d = defaultdict(int)
    d[0] = 1
    coordinates.sort()
    for i in range(N - 1):
        for j in range(i + 1, N):
            curx = coordinates[j][0] - coordinates[i][0]
            cury = coordinates[j][1] - coordinates[i][1]
            d[curx, cury] += 1
    return N - max(d.values())

